import React, {useState} from "react";
import axios from "axios";

function MostPopularProducts() {

    const [MostPopularArray, updateMostPopularArray] = useState([]);
    const [error, setError] = useState('');

    updateMostPopularArray(null);
    setError(null);

    axios.get('http://localhost:8080/products/')
        .then(res => {
            console.log(res.data);
            updateMostPopularArray(res.data);
        })
        .catch(err => {
            setError(err.message);
        });


    if(MostPopularArray != null) {
        return (
            <div className="container">
                <h1> Most popular </h1>
                {MostPopularArray.map(product => (
                        <div  className="card">
                            <img src="" alt="img" style="width:100%"/>
                            <h1>product.name1</h1>
                            <h3>product.name2</h3>
                            <p>product.genre</p>
                            <p> product.description </p>

                            <h2>Star Rating</h2>
                            <span className="fa fa-star checked"></span>
                            <span className="fa fa-star checked"></span>
                            <span className="fa fa-star checked"></span>
                            <span className="fa fa-star"></span>
                            <span className="fa fa-star"></span>

                            <button>View details</button>
                        </div>
                    )
                )}
            </div>
        );
    }
    else if(error != null){
        return (
            <div className="container">
                <h3> Error: {error}</h3>
            </div>
        );
    }
    else{
        return (
            <div className="container">
                <h3> Most popular </h3>
                <h1>Something went wrong!!!</h1>
            </div>
        );
    }
}

export default MostPopularProducts;
